import React from "react";
import { useNavigate } from "react-router-dom";
import "./Manager.css"; // 可选：用于自定义样式
import logo from "../assets/images.png"; // 确保你有 logo 图片放在 /src/assets 下

const Manager = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="manager-page">
      <img src={logo} alt="Logo" className="manager-logo" />

      <div className="button-grid">
        <button onClick={() => handleNavigation("/drink-menu")}>Drink Menu</button>
        <button onClick={() => handleNavigation("/inventory")}>Inventory</button>
        <button onClick={() => handleNavigation("/trends")}>Trends</button>
        <button onClick={() => handleNavigation("/employees")}>Employee</button>
        <button onClick={() => handleNavigation("/order")}>Orders</button>
        <button onClick={() => handleNavigation("/add-seasonal")}>Add Seasonal Menu Item</button>
        <button onClick={() => handleNavigation("/product-usage")}>Product Usage</button>
        <button onClick={() => handleNavigation("/x-report")}>X-Report</button>
        <button onClick={() => handleNavigation("/z-report")}>Z-Report</button>
        <button onClick={() => handleNavigation("/")}>Logout</button>
      </div>
    </div>
  );
};

export default Manager;
